import React from 'react';
import './List-Selection.scss';

export class ListSelection extends React.Component<{name: string}> {
    render() {
        return (
            <div className="ListSelection">
                {this.props.name}
                <i className="fa fa-caret-right"></i>
            </div>
        );
    }
};
